import './brand.css';
import {google,slack,atlassian,shopify} from './import'

export const Brand = () => {
  return (
    <div className="gpt3_brand section_padding">
      <div><img src={google} alt="" /></div>
      <div><img src={slack} alt="" /></div>
      <div><img src={atlassian} alt="" /></div>
      <div><img src={shopify} alt="" /></div>
    </div>
  )
}
